- input: "TEXT\x1CC00019331\x1CX0\x1C\x1CF3XA\x1C(A2) This amended filing makes a
    minor correction to the reported year-to-date totals on lines 11.a.i and 11.a.ii.
    (1) Payroll-related items on Schedule H4 of this report were for employees that
    spent 25% or less of their compensated time on Federal activity. (2) Any receipts
    on lines 15 or 17 were assessed at the usual and normal charge. (3) Any fundraising
    expenses on line 21b were for the benefit of the committee and did not support
    a federal candidate. (4) Receipts on Schedule A supporting line 11 from unregistered
    committees Citizens for Soletski, Friends of Andy Jorgensen, and Friends of Mason
    have been deemed permissible. These contributions were made by non-Federal candidates
    that had the required funds from Federally-permissible sources. The funds were
    verified to have come from permissible sources and no amount exceeded the $1,000
    threshold that would require the committees to register with the Commission. (5)
    This report includes memoed Schedule A entries for contributions raised by the
    ASDC Dollars for Democrats and WI State Party Victory Fund joint fundraising programs.
    The committee has received part of its share of the proceeds as of the end of
    the reporting period, and expects to receive its remaining share during the next
    three reporting periods. (6) This report includes $380.00 in fraudulent contributions
    the committee received in late March by credit card under false names. The contributions
    were discovered and refunded in the next reporting period; refunds will be disclosed
    on the committee's next report.\n"
